function App() {
  return (
    <div className="app">
      <Header />
      <Hero 
        title="See everything with Clarity" 
        msg="Buying eyewear should leave you happy and good-looking, with money in your pocket. Glasses, sunglasses, and contacts—we’ve got your eyes covered." 
        btn="Shop Now"
        img="assets/person1.jpg"/>
      <ProductCard2/>
      <ProductPanel1 title="Featured Products" link="#"/>
      <ProductPanel1 title="Recommended Products" link="#"/>
      <Footer />
    </div>
  );
}

export default App;
